import React from "react";
import { useEffect } from 'react';
import "./styles.css";
import Button from "@mui/material/Button";
import { useNavigate } from "react-router-dom";
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
    status: {
        danger: '#e53e3e',
    },
    palette: {
        primary: {
            main: '#ff8a00',
        },
        neutral: {
            main: '#ffffff',
            contrastText: '#ff8a00',
        },
    },
});

const LoginButton = () => {
    return (
        <div id="loginButton">
            <GoogleLogin
                buttonText='Login'
                onSuccess={onSuccess}
                onFailure={onFailure}
                cookiePolicy={'single_host_origin'}
                isSignedIn={true}
            />
        </div>
    )
};

const onSuccess = (result) => {
    console.log("LOGIN SUCCESS; Current User: " + result.profileObj);
}

const onFailure = (result) => {
    console.log("LOGIN FAILED; Result: " + result);
}


function LoginPage() {
    const navigate = useNavigate();
    const clientID = "1090577027379-t1c9h7v7onccmjpv1j4fr0jsa06dle8i.apps.googleusercontent.com";

    const handleResponse = (response) => {
        console.log("Encoded JWT ID Token: " + response.credential);
    }

    useEffect(() => {
        /* global google */
        google.accounts.id.initialize({
            client_id: clientID,
            callback: handleResponse,
        });

        google.acounts.id.renderButton(
            document.getElementById('signInDiv'),
            { theme: "outline", size: "large" },
        )
    }, []);

    return (
        <>
            <ThemeProvider theme={theme}>
                <div>
                    <h2>This is a member-only page.</h2>
                    <h4>Please log-in first to continue.</h4>
                </div>
                <div id="signInDiv"></div>
                <Button style={{ "display": "flex" }}
                    variant="contained"
                    color="neutral"
                    onClick={() => { navigate('/') }}
                    className="navHome">Return Home</Button>
            </ThemeProvider>
        </>
    )
}

export default LoginPage;
